function setFontSize(e=1){var n=jQuery(window).width();if(n<=991){var t=window.finalFont=29.1*(n/991);return jQuery("html").css("font-size",t+"px"),e/t}if(992<=n&&n<=1920){n=window.finalFont=16*(n/1920);return jQuery("html").css("font-size",n+"px"),e/n}jQuery("html").css("font-size","16px")}setFontSize(),jQuery(window).resize(setFontSize);